import { Link } from "react-router-dom";

import { Header, Button } from 'semantic-ui-react';


export const header = () => {
    console.log("You've reached header.js");
    <Header as='h1' block textAlign='Center' color='blue'>
        Welcome to MyTTF
        <Button floated='right'>Login</Button>
    </Header>
}
